func TestWebhookHandler_createWave(t *testing.T) {

	option := NewOption()
	option.Debug = true

	payloadList := getWaveTestPayload()

	handler := NewWebhookHandler(NewOption(), t.Logf)

	// 
	handler.initBuf()
	for _, payload := range payloadList {
		handler.pushToBuffer(payload)
	}

	// 
	rawData, err := handler.channelBuffer.GetSortedBytes()
	if !assert.NoError(t, err) {
		return
	}
	assert.NotEmpty(t, rawData)

	// wave
	path, err := handler.createWave(rawData)
	if !assert.NoError(t, err) {
		return
	}

	file, err := os.Open(path)
	defer file.Close()
	defer os.Remove(path)

	if !assert.NoError(t, err) {
		return
	}

	defer file.Close()
	defer os.Remove(path)

	b, err := ioutil.ReadAll(file)
	//t.Logf("target len:%d byte", len(b))
	//ioutil.WriteFile("dest.wav", b, os.ModePerm)
	assert.NoError(t, err)

	t.Logf("target binary:%s", b)
}

func getWaveTestPayload() []sakura.Payload {

	var res []sakura.Payload

	for i, js := range requestSampleJSONList {
		var payload sakura.Payload
		err := json.Unmarshal([]byte(js), &payload)
		if err != nil {
			panic(fmt.Errorf("index:%d, error : %s", i, err))
		}
		res = append(res, payload)
	}

	return res
}
